import{o as t,c as a,a as l}from"./app.e2261b09.js";const e='{"title":"Коротко о состояние науки о данных в 2020 году","description":"","frontmatter":{"title":"Коротко о состояние науки о данных в 2020 году","date":"2020/12/24 18:10:23","cover_index":"http://picsum.photos/450/450?random=11","tags":null,"categories":["aboutMe"]},"relativePath":"blog/NY2020.md","lastUpdated":1628440207828}',r={},i=l('<p>Коротко о состояние науки о данных в 2020 году: от ажиотажа к зрелости(с)</p><p>[Forwarded from ILYA_N_KLISHIN]</p><p>Хорошая новость в том, что шумиха вокруг науки о данных и машинного обучения уступает место реальности. Плохая новость в том, что нам предстоит пройти долгий путь, прежде чем мы достигнем зрелости. Предприятиям, ученым и специалистам в области данных нужно поработать, прежде чем дисциплина действительно сможет раскрыть свой потенциал для бизнеса и общества. Аналитикам в области данных нужно поработать над образованием заказчика ибо &quot;если задача поставлена не точно, то ответ может удивить&quot;(с).</p><p>Подробнее в нашем отчете о состоянии науки о данных за 2020 год.</p><p>Хотите получить отчет и мои поздравления? Пишите - пришлю!</p><p>Мои поздравления в цифрах</p><p>С наступающим 2021 годом! 2021 будет лучше с вероятностью 97,3459235%!*** 2021 год пройдет, как data-first! В 2012 году любите data и они позволят вам быть точными в своих решениях или приблизительно правыми; В 2021 году любите data и они не позволят вам быть не правыми; В 2021 году - году data first, изучите данные первым делом и целевая аудитория доставит вам свои ресурсы, средства и восхищения!</p><p>В 2021 году data первыми скажут вам горькую правду, если с 2,6540765% вероятностью будет хуже, чем в 2020 году; хотя и сейчас уже очевидна экспертная оценка &quot;куда уж хуже&quot;. Уже сейчас 2020 год уходит и с 97,3459235% вероятностью всё будет хорошо уже начиная с сегодняшнего дня! Вам всё-всё (или почти все - 97,3459235%) удастся! А если data-first, то и всё-всё удастся и еще 97,3459235% сверх того!****</p><p>НО 100% МЫ ПОЗДРАВЛЯЕМ ВАС С НАСТУПАЮЩИМ НОВОМ 2021 ГОДОМ!!!</p><ul><li>Отчет подготовлен в формате .pdf и .html(сайт, состоящий из статичных html); данные отчеты выгружаются в формате xls, json и (dump mongodb) ** Стоимость отчета в процентах - 2,6540765 от рыночной стоимости будет применена только в 2,6540765% случаев. J *** Расчет вероятности проведен на основании</li></ul><ul><li>Big Data(см. подробное описание списков данных)</li><li>AI Platform лучшую в своем классе модель машинного обучения</li><li>и Anaconda (Коллективное издание Тысячи тщательно отобранных пакетов для анализа данных в репозитории корпоративного уровня. Идеально для масштабирования использования Python и R в дисциплинах науки о данных.)</li><li>обработано GCP us-central1 (Айова), Yandex-team, native server cluster</li></ul><ul><li>вероятность стечения этих обстоятельств не поддаётся расчету доступными средствами, требуется увеличение мощности и доработка моделирования в 2021 году</li></ul><p>Время. Отношения. Выбор. <a href="https://ilyaklishin.ru/" target="_blank" rel="noopener noreferrer">https://ilyaklishin.ru/</a> - это здоровый образ мышления и жизни.</p>',13);r.render=function(l,e,r,p,o,n){return t(),a("div",null,[i])};export{e as __pageData,r as default};
